9;a:1:{s:12:"created_time";i:1599248058;}i:250;a:1:{s:7:"caption";s:1128:"✨What if every day was full of magic and wonder? ✨

Well, it can be with the power of joyspotting! 

I first learned about the concept listening to #thenextbigideapodcast with #IngridFetellLee from @arstheticsofjoy.

 She describes joyspotting as the practice of going out into the world and finding ordinary objects that make you extraordinarily happy.

In recent months, I’ve spent more time walking/jogging on trails across our city than ever before. 

Since adopting the practice of joyspotting, I’ve found myself stopping to smell the roses (and snap pictures)! 

I think I’m particularly joyspotting plants these days because I know winter is coming, so I have to enjoy these little treasures while they last. 

What have you discovered joyspotting?

